import { Component } from '@angular/core';

@Component({
  selector: 'app-header',
  templateUrl: './header.component.html',
  styleUrls: ['./header.component.scss']
})
export class HeaderComponent {

}
<nav class="bg-gray-800 p-4">
  <div class="container mx-auto flex justify-between items-center">
    <div class="text-white text-lg font-bold">Photographer Portfolio</div>
    <div>
      <a routerLink="/" class="text-gray-300 hover:bg-gray-700 hover:text-white px-3 py-2 rounded">Home</a>
      <a routerLink="/gallery" class="text-gray-300 hover:bg-gray-700 hover:text-white px-3 py-2 rounded">Gallery</a>
      <a routerLink="/portfolio" class="text-gray-300 hover:bg-gray-700 hover:text-white px-3 py-2 rounded">Portfolio</a>
      <a routerLink="/about" class="text-gray-300 hover:bg-gray-700 hover:text-white px-3 py-2 rounded">About</a>
      <a routerLink="/contact" class="text-gray-300 hover:bg-gray-700 hover:text-white px-3 py-2 rounded">Contact</a>
    </div>
  </div>
</nav>
